Source.BuildSpec:
{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "npm install -g aws-cdk",
        "npm install typescript --force",
        "pip install -r requirements.txt",
        "pip install aws_cdk.aws_glue_alpha",
        "cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "cdk.out",
    "files": "**/*"
  }
}
